  grid:{
    width: '100%',
    margin:'0px'
  }
}));

function Viewdirect () {
  const classes = useStyles();

  return (
      <Grid container spacing={3} className = {classes.grid}>
          <Grid item>

          </Grid>
      </Grid>
    
  );
}

export default Viewdirect;
